885	2	App\\Models\\Community\\FeedPost	11	updated	{"content":"<p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Excited to be at the Canon Think Big Malaysia 2025, where Adrian Marcellus represented YB Gobind Singh Deo and reaffirmed Malaysia\\u2019s commitment to accelerating digital transformation and advancing our vision of becoming an AI Nation by 2030. He emphasised clear timelines, strong digital-talent development, and embedding AI and innovation as national disciplines.<\\/span><\\/p><p class=\\"ql-align-justify\\"><br><\\/p><p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">The event, themed \\u201c<\\/span><strong style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Future-Ready Malaysia: Innovation, Resilience, Growth<\\/strong><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">,\\u201d marked the final edition of the Think Big Malaysia 2025 series and strengthened collaboration with industry partners like Canon toward an inclusive, future-ready digital economy.<\\/span><\\/p>","updated_at":"2025-11-25 09:57:34"}	60.53.183.179	Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/141.0.0.0 Safari/537.36	2025-11-25 09:57:34	2025-11-25 09:57:34
886	2	App\\Models\\Community\\FeedPost	10	updated	{"content":"<p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Glad to be part of GovInsider Live: MY.AI Day 2025, where Tuan Fabian Bigar and Puan Ellina Roslan shared key perspectives on Malaysia\\u2019s digital and AI journey.<\\/span><\\/p><p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Tuan Fabian highlighted how the AI Nation 2030 vision and RMK13 priorities are driving more connected and citizen-focused public services.<\\/span><\\/p><p class=\\"ql-align-justify\\"><br><\\/p><p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Puan Ellina stressed the importance of a digital-first mindset, stronger AI capabilities and cross-agency collaboration to realise a whole-of-government approach.<\\/span><\\/p>","updated_at":"2025-11-25 09:57:56"}	60.53.183.179	Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/141.0.0.0 Safari/537.36	2025-11-25 09:57:56	2025-11-25 09:57:56
