892	2	App\\Models\\Community\\FeedPost	7	updated	{"content":"<p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Glad to be part of GovInsider Live: MY.AI Day 2025, where Tuan Fabian Bigar and Puan Ellina Roslan were featured speakers.<\\/span><\\/p><p class=\\"ql-align-justify\\"><br><\\/p><p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Tuan Fabian, in a Fireside Chat, outlined how the AI Nation 2030 vision and RMK13 are transforming Malaysia\\u2019s public sector toward more connected, intelligent and citizen-centric services.<\\/span><\\/p><p class=\\"ql-align-justify\\"><br><\\/p><p class=\\"ql-align-justify\\"><span style=\\"background-color: transparent; color: rgb(0, 0, 0);\\">Puan Ellina, speaking on a whole-of-government panel, emphasised that meaningful digital transformation starts with people and culture - building a digital-first mindset, strengthening AI literacy and fostering collaboration across ministries. She reinforced that achieving a truly citizen-centric, AI-enabled Malaysia requires agencies to operate as \\u201cOne Government, One Mission.\\u201d<\\/span><\\/p>","updated_at":"2025-11-25 09:58:53"}	60.53.183.179	Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/141.0.0.0 Safari/537.36	2025-11-25 09:58:53	2025-11-25 09:58:53
