947	2	App\\Models\\Learning\\Course	11	updated	{"title":"AI untuk Rakyat","description":"\\u2018AI untuk Rakyat\\u2019 is a self-learning online program designed to raise public awareness about Artificial Intelligence (AI). It aims to demystify AI for people from all walks of life \\u2013 a student, a stay-at-home parent, a professional in any field, a senior citizen - basically, anyone interested in getting acquainted with it and wanting to build a \\u2018Digital First Mindset'.\\r\\n\\r\\nThe program is divided into two sections: AI Aware and AI Appreciate. \\r\\nBoth sections can be completed in less than four hours. Each section is based on AI-related concepts explained through engaging activities and quizzes. You can take the quizzes as many times as you want. After you complete these quizzes, you become bearers of AI Aware and AI Appreciate badges that you can share on your social media accounts.","tags":"[\\"Artificial Intelligence\\",\\"Human Intelligence\\",\\"responsible AI\\",\\"AI ethics\\"]","others":"{\\"difficulty\\":\\"beginner\\",\\"duration_hours\\":\\"4\\"}","visibility":"public","updated_at":"2025-11-26 01:20:24"}	60.53.183.179	Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/141.0.0.0 Safari/537.36	2025-11-26 01:20:24	2025-11-26 01:20:24
