14	2	7	Blockchain untuk Rakyat	blockchain-untuk-rakyat-wg54J7beMf	Blockchain untuk Rakyat is a foundational course designed to introduce Malaysians to the transformative potential of blockchain technology. Tailored for everyday learners with no prior technical background, this course aims to demystify blockchain by explaining its core concepts, practical uses, and relevance to industries such as finance, supply chain and identity management. With real-world examples and local context, Blockchain untuk Rakyat empowers citizens to better understand how this emerging technology can support transparency, security, and innovation in shaping Malaysias digital future.	["Blockchain","Bitcoin","Ethereum"]	{"difficulty":"beginner","duration_hours":"1","course_url":"https:\\/\\/rakyatdigital.gov.my\\/courses\\/blockchain-untuk-rakyat"}	storage/2025/11/26/courses/banners/HE9PA5ngK9zz7A6UMVaO5psS8I71n8iMc1STi7BX.png	public	2025-11-26 01:22:08	2025-12-09 03:15:43	\N
11	2	7	AI untuk Rakyat	kemahiran-digital-untuk-malaysia-yang-lebih-bersinar-CLcstxs2Ph	AI untuk Rakyat is a self-learning online program designed to raise public awareness about Artificial Intelligence (AI). It aims to demystify AI for people from all walks of life  a student, a stay-at-home parent, a professional in any field, a senior citizen - basically, anyone interested in getting acquainted with it and wanting to build a Digital First Mindset'.\r\n\r\nThe program is divided into two sections: AI Aware and AI Appreciate. \r\nBoth sections can be completed in less than four hours. Each section is based on AI-related concepts explained through engaging activities and quizzes. You can take the quizzes as many times as you want. After you complete these quizzes, you become bearers of AI Aware and AI Appreciate badges that you can share on your social media accounts.	["Artificial Intelligence","Human Intelligence","Responsible AI","AI ethics"]	{"difficulty":"beginner","duration_hours":"4","course_url":"https:\\/\\/rakyatdigital.gov.my\\/courses\\/ai-untuk-rakyat"}	storage/2025/11/26/courses/banners/U9xxlFSsDdTC9Q1J0e05StpXmCaJCrgP9UWCaz3G.png	public	2025-11-25 02:57:16	2025-12-09 03:14:41	\N
16	2	7	CyberSAFE untuk Rakyat	cybersafe-untuk-rakyat-7SSvW73x1y	Welcome to CyberSAFE untuk Rakyat, a comprehensive course designed to provide you with the essential knowledge and skills to safeguard your digital assets in todays interconnected world. As cyber threats become increasingly sophisticated, understanding cybersecurity principles and practices is vital for both individuals and organisations.\r\n\r\nThis course will cover fundamental concepts such as threat identification, risk management, and the implementation of effective security measures. You will engage in knowledge checks at the end of each module to reinforce your learning and ensure a solid grasp of how to protect information and systems from malicious attacks. Successfully completing all modules and their respective knowledge checks will earn you a completion certificate, recognising your proficiency in cybersecurity essentials.	["Cybersecurity","Personal Data Protection","Cybersafety","Mobile Device Security"]	{"difficulty":"beginner","duration_hours":"1","course_url":"https:\\/\\/rakyatdigital.gov.my\\/courses\\/cybersafer-untuk-rakyat"}	storage/2025/11/26/courses/banners/5XL7jrLYY0uqRhHWBZvqLHVrbeD4a3il9uijMl0G.jpg	public	2025-11-26 01:25:13	2025-12-09 03:16:56	\N
