207	admin@admin.com	event	"{\\"subject\\":\\"A new event has been added titled 'EDLP Appreciation Dinner 2025'. Please review and approve it.\\",\\"message\\":\\"A new Event has been added for <a href=\\\\\\"https:\\\\\\/\\\\\\/edlnexus.gov.my\\\\\\/admin\\\\\\/event-setup\\\\\\">EDLP Appreciation Dinner 2025<\\\\\\/a>. Please visit the event page to review and approve it.\\",\\"title\\":\\"New Event Created\\",\\"event\\":{\\"owner_id\\":4,\\"title\\":\\"EDLP Appreciation Dinner 2025\\",\\"about\\":\\"The EDLP Appreciation Dinner 2025 celebrates participants from Cohorts 6 to 10 and marks the official launch of the EDL Nexus alumni portal. Held on 5 December 2025 at the Marriott Putrajaya International Convention Centre, the RetroGlam-themed evening will be graced by Tuan Fabian Bigar, Secretary General of the Ministry of Digital, with Cohorts 1 to 5 also joining the celebration.\\",\\"details\\":\\"The Executive Digital Leadership Programme (EDLP) Appreciation Dinner 2025 will take place on 5 December 2025, from 6:00 PM to 10:00 PM, at the Marriott Putrajaya International Convention Centre, Putrajaya.\\\\r\\\\n\\\\r\\\\nThis RetroGlam-themed event brings together EDLP leaders from across the programme\\\\u2019s journey, with a special focus on honouring participants from Cohort 6 to Cohort 10 for their milestones and contributions. Participants from Cohort 1 to Cohort 5 are also invited to join the celebration, strengthening fellowship across the growing EDLP community.\\\\r\\\\n\\\\r\\\\nA key highlight of the evening is the official launch of the EDL Nexus, a dedicated digital platform designed to connect alumni, foster continuous learning, and support collaborative leadership within Malaysia\\\\u2019s digital-transformation ecosystem.\\\\r\\\\n\\\\r\\\\nThe dinner will be graced by the Guest of Honour, Tuan Fabian Bigar, Secretary General of the Ministry of Digital, who will commemorate this milestone with the EDLP community.\\\\r\\\\n\\\\r\\\\nThis event serves as a moment of appreciation, connection and renewed commitment toward nurturing Malaysia\\\\u2019s next generation of digital leaders.\\",\\"location\\":\\"Marriott Putrajaya, Putrajaya\\",\\"start_at\\":\\"2025-12-05\\",\\"end_at\\":\\"2025-12-05\\",\\"visibility\\":\\"public\\",\\"status\\":\\"draft\\",\\"approval_status\\":\\"pending\\",\\"created_by\\":4,\\"updated_by\\":4,\\"updated_at\\":\\"2025-11-26T02:41:07.000000Z\\",\\"created_at\\":\\"2025-11-26T02:41:07.000000Z\\",\\"id\\":13},\\"url\\":\\"https:\\\\\\/\\\\\\/edlnexus.gov.my\\\\\\/admin\\\\\\/event-setup\\"}"	<!DOCTYPE html>\n<html>\n\n<head>\n    <meta charset="UTF-8">\n    <title>New Event Created</title>\n    <style>\n        body {\n            font-family: Arial, sans-serif;\n            background-color: #f9f9f9;\n            color: #333;\n            padding: 20px;\n        }\n\n        .container {\n            background-color: #ffffff;\n            border-radius: 8px;\n            padding: 30px;\n            max-width: 600px;\n            margin: auto;\n            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);\n        }\n\n        h1 {\n            font-size: 24px;\n            margin-bottom: 20px;\n            color: #2c3e50;\n        }\n\n        p {\n            font-size: 16px;\n            line-height: 1.6;\n        }\n\n        a {\n            color: #3498db;\n            text-decoration: none;\n        }\n\n        .footer {\n            margin-top: 30px;\n            font-size: 12px;\n            color: #999;\n            text-align: center;\n        }\n\n        .logo {\n            max-height: 60px;\n            margin-bottom: 20px;\n        }\n\n        .banner {\n            width: 100%;\n            border-radius: 6px;\n            margin: 20px 0;\n        }\n    </style>\n</head>\n\n<body>\n    <div class="container">\n        \n        <h1>New Event Created</h1>\n\n        \n        <p>A new Event has been added for <a href="https://edlnexus.gov.my/admin/event-setup">EDLP Appreciation Dinner 2025</a>. Please visit the event page to review and approve it.</p>\n\n                    <hr>\n            <p><strong>Event Details:</strong></p>\n            <ul>\n                <li><strong>Title:</strong> EDLP Appreciation Dinner 2025</li>\n                <li><strong>About:</strong> The EDLP Appreciation Dinner 2025 celebrates participants from Cohorts 6 to 10 and marks the official launch of the EDL Nexus alumni portal. Held on 5 December 2025 at the Marriott Putrajaya International Convention Centre, the RetroGlam-themed evening will be graced by Tuan Fabian Bigar, Secretary General of the Ministry of Digital, with Cohorts 1 to 5 also joining the celebration.</li>\n                <li><strong>Details:</strong> The Executive Digital Leadership Programme (EDLP) Appreciation Dinner 2025 will take place on 5 December 2025, from 6:00 PM to 10:00 PM, at the Marriott Putrajaya International Convention Centre, Putrajaya.\r\n\r\nThis RetroGlam-themed event brings together EDLP leaders from across the programmes journey, with a special focus on honouring participants from Cohort 6 to Cohort 10 for their milestones and contributions. Participants from Cohort 1 to Cohort 5 are also invited to join the celebration, strengthening fellowship across the growing EDLP community.\r\n\r\nA key highlight of the evening is the official launch of the EDL Nexus, a dedicated digital platform designed to connect alumni, foster continuous learning, and support collaborative leadership within Malaysias digital-transformation ecosystem.\r\n\r\nThe dinner will be graced by the Guest of Honour, Tuan Fabian Bigar, Secretary General of the Ministry of Digital, who will commemorate this milestone with the EDLP community.\r\n\r\nThis event serves as a moment of appreciation, connection and renewed commitment toward nurturing Malaysias next generation of digital leaders.</li>\n                <li><strong>Type:</strong> public</li>\n                <li><strong>Location:</strong> Marriott Putrajaya, Putrajaya</li>\n                <li><strong>Start At:</strong> 2025-12-05</li>\n                <li><strong>End At:</strong> 2025-12-05</li>\n                <li><strong>Start Time:</strong> </li>\n                <li><strong>Time Zone:</strong> </li>\n                <li><strong>Status:</strong> Pending</li>\n            </ul>\n        \n        <br>\n\n        <strong>Link:</strong> <a href="https://edlnexus.gov.my/admin/event-setup">https://edlnexus.gov.my/admin/event-setup</a>\n\n        <div class="footer">\n            <hr>\n            <p>This is an automated notification. Please do not reply to this email.</p>\n        </div>\n    </div>\n</body>\n\n</html>\n	sent	\N	2025-11-26 02:41:07	2025-11-26 02:41:08
