208	admin@admin.com	event	"{\\"subject\\":\\"A new event has been added titled 'EDLP Digital Leadership Roundtable: The AI-Ready Civil Service'. Please review and approve it.\\",\\"message\\":\\"A new Event has been added for <a href=\\\\\\"https:\\\\\\/\\\\\\/edlnexus.gov.my\\\\\\/admin\\\\\\/event-setup\\\\\\">EDLP Digital Leadership Roundtable: The AI-Ready Civil Service<\\\\\\/a>. Please visit the event page to review and approve it.\\",\\"title\\":\\"New Event Created\\",\\"event\\":{\\"owner_id\\":4,\\"title\\":\\"EDLP Digital Leadership Roundtable: The AI-Ready Civil Service\\",\\"about\\":\\"This roundtable brings together EDLP alumni and digital-transformation leaders to discuss strategies for building an AI-ready and data-driven civil service. The session explores leadership roles, skills development, governance readiness and practical approaches for accelerating adoption across ministries and agencies.\\",\\"details\\":\\"The EDLP Digital Leadership Roundtable: The AI-Ready Civil Service is a focused half-day dialogue designed for EDLP alumni and senior digital leaders across government.\\\\r\\\\n\\\\r\\\\nTaking place on 12 December 2025 at the Pulse Grande Hotel, Putrajaya, the session will explore how Malaysia can strengthen leadership capacity, governance readiness and workforce capability to support the nation\\\\u2019s digital transformation and AI agenda.\\\\r\\\\n\\\\r\\\\nParticipants will share challenges and best practices on:\\\\r\\\\n\\\\r\\\\n- developing AI-ready and data-literate leadership pipelines\\\\r\\\\n\\\\r\\\\n- strengthening digital governance and ethics\\\\r\\\\n\\\\r\\\\n- accelerating AI adoption across ministries\\\\r\\\\n\\\\r\\\\n- building collaborative, cross-agency execution models\\\\r\\\\n\\\\r\\\\nThe roundtable aims to foster candid exchange, deepen collaboration and strengthen the EDLP community\\\\u2019s role in shaping a future-ready public sector.\\",\\"location\\":\\"Persada Putrajaya Conference Room, Level 3, P