nt Details:</strong></p>\n            <ul>\n                <li><strong>Title:</strong> EDLP Digital Leadership Roundtable: The AI-Ready Civil Service</li>\n                <li><strong>About:</strong> This roundtable brings together EDLP alumni and digital-transformation leaders to discuss strategies for building an AI-ready and data-driven civil service. The session explores leadership roles, skills development, governance readiness and practical approaches for accelerating adoption across ministries and agencies.</li>\n                <li><strong>Details:</strong> The EDLP Digital Leadership Roundtable: The AI-Ready Civil Service is a focused half-day dialogue designed for EDLP alumni and senior digital leaders across government.\r\n\r\nTaking place on 12 December 2025 at the Pulse Grande Hotel, Putrajaya, the session will explore how Malaysia can strengthen leadership capacity, governance readiness and workforce capability to support the nations digital transformation and AI agenda.\r\n\r\nParticipants will share challenges and best practices on:\r\n\r\n- developing AI-ready and data-literate leadership pipelines\r\n\r\n- strengthening digital governance and ethics\r\n\r\n- accelerating AI adoption across ministries\r\n\r\n- building collaborative, cross-agency execution models\r\n\r\nThe roundtable aims to foster candid exchange, deepen collaboration and strengthen the EDLP communitys role in shaping a future-ready public sector.</li>\n                <li><strong>Type:</strong> public</li>\n                <li><strong>Location:</strong> Persada Putrajaya Conference Room, Level 3, Pulse Grande Hotel</li>\n                <li><strong>Start At:</strong> 2025-12-12</li>\n                <li><strong>End At:</strong> 2025-12-12</li>\n                <li><strong>Start Time:</strong> </li>\n                <li><strong>Time Zone:</strong> </li>\n                <li><strong>Status:</strong> Pending</li>\n            </ul>\n        \n        <br>\n\n        <strong>Link:</