13	4	EDLP Appreciation Dinner 2025	The EDLP Appreciation Dinner 2025 celebrates participants from Cohorts 6 to 10 and marks the official launch of the EDL Nexus alumni portal. Held on 5 December 2025 at the Marriott Putrajaya International Convention Centre, the RetroGlam-themed evening will be graced by Tuan Fabian Bigar, Secretary General of the Ministry of Digital, with Cohorts 1 to 5 also joining the celebration.	The Executive Digital Leadership Programme (EDLP) Appreciation Dinner 2025 will take place on 5 December 2025, from 6:00 PM to 10:00 PM, at the Marriott Putrajaya International Convention Centre, Putrajaya.\r\n\r\nThis RetroGlam-themed event brings together EDLP leaders from across the programmes journey, with a special focus on honouring participants from Cohort 6 to Cohort 10 for their milestones and contributions. Participants from Cohort 1 to Cohort 5 are also invited to join the celebration, strengthening fellowship across the growing EDLP community.\r\n\r\nA key highlight of the evening is the official launch of the EDL Nexus, a dedicated digital platform designed to connect alumni, foster continuous learning, and support collaborative leadership within Malaysias digital-transformation ecosystem.\r\n\r\nThe dinner will be graced by the Guest of Honour, Tuan Fabian Bigar, Secretary General of the Ministry of Digital, who will commemorate this milestone with the EDLP community.\r\n\r\nThis event serves as a moment of appreciation, connection and renewed commitment toward nurturing Malaysias next generation of digital leaders.	Marriott Putrajaya, Putrajaya	2025-12-05 00:00:00	2025-12-05 00:00:00	public	draft	pending	\N	\N	\N	0	0	0	4	4	2025-11-26 02:41:07	2025-11-26 03:05:11	2025-11-26 03:05:11	\N
15	4	Digital Leaders Year-End Soire 2025	A relaxed year-end soire celebrating innovation, leadership and community within Malaysias digital-economy ecosystem. EDLP alumni and invited digital leaders gather for networking, reflections and conversations on shared goals for 2026.	The Digital Leaders Soire: Innovation & Impact Night is an exclusive year-end gathering for EDLP alumni and invited members of Malaysias wider digital-leadership community.\r\n\r\nHeld on 20 December 2025 at the Grand Skyview Lounge, EQ Kuala Lumpur, the soire offers a relaxed yet elegant setting for leaders to reconnect, reflect on 2025 milestones and exchange perspectives on emerging digital trends shaping 2026.\r\n\r\nHighlights of the evening include:\r\n\r\n- curated networking sessions\r\n\r\n- a short segment on Innovation & Impact: Whats Next for 2026\r\n\r\n- appreciation moments recognising contributors to Malaysias digital-transformation agenda\r\n\r\n- open-floor conversations to encourage cross-sector collaboration\r\n\r\nThis soire serves as a warm, inspiring close to the year - reinforcing relationships, celebrating progress, and strengthening the shared vision for Malaysias digital future.	Grand Skyview Lounge, EQ Kuala Lumpur	2025-12-20 00:00:00	2025-12-20 00:00:00	public	published	approved	\N	storage/2025/11/26/events/banners/nMwGOfFHRPOB0JfpcIyDu5Ia0WQ8IyfY2jIiZUug.jpg	\N	1	1	0	4	4	2025-11-26 02:52:50	2025-11-28 08:17:49	\N	18:30:00
14	4	EDLP Digital Leadership Roundtable: The AI-Ready Civil Service	This roundtable brings together EDLP alumni and digital-transformation leaders to discuss strategies for building an AI-ready and data-driven civil service. The session explores leadership roles, skills development, governance readiness and practical approaches for accelerating adoption across ministries and agencies.	The EDLP Digital Leadership Roundtable: The AI-Ready Civil Service is a focused half-day dialogue designed for EDLP alumni and senior digital leaders across government.\r\n\r\nTaking place on 12 December 2025 at the Pulse Grande Hotel, Putrajaya, the session will explore how Malaysia can strengthen leadership capacity, governance readiness and workforce capability to support the nations digital transformation and AI agenda.\r\n\r\nParticipants will share challenges and best practices on:\r\n\r\n- developing AI-ready and data-literate leadership pipelines\r\n\r\n- strengthening digital governance and ethics\r\n\r\n- accelerating AI adoption across ministries\r\n\r\n- building collaborative, cross-agency execution models\r\n\r\nThe roundtable aims to foster candid exchange, deepen collaboration and strengthen the EDLP communitys role in shaping a future-ready public sector.	Persada Putrajaya Conference Room, Level 3, Pulse Grande Hotel	2025-12-12 00:00:00	2025-12-12 00:00:00	public	published	approved	\N	storage/2025/11/26/events/banners/rRiOTMYrkhsKyTUrLF8souQ5WptK08Ap2KeZxf75.jpg	\N	1	1	0	4	4	2025-11-26 02:49:56	2025-11-26 07:52:13	\N	\N
