7	2	<p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">Glad to be part of GovInsider Live: MY.AI Day 2025, where YBhg. Tuan Fabian Bigar and Puan Ellina Roslan were featured speakers.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">YBhg. Tuan Fabian, in a Fireside Chat, outlined how the AI Nation 2030 vision and RMK13 are transforming Malaysias public sector toward more connected, intelligent and citizen-centric services.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">Puan Ellina, speaking on a whole-of-government panel, emphasised that meaningful digital transformation starts with people and culture - building a digital-first mindset, strengthening AI literacy and fostering collaboration across ministries. She reinforced that achieving a truly citizen-centric, AI-enabled Malaysia requires agencies to operate as </span><strong style="background-color: transparent; color: rgb(0, 0, 0);">One Government, One Mission</strong><span style="background-color: transparent; color: rgb(0, 0, 0);">.</span></p>	public	published	\N	1	0	0	2	2	2025-11-24 05:09:03	2025-11-26 02:13:10	2025-11-26 02:13:10
11	2	<p style="text-align: left;">Excited to be at the Canon Think Big Malaysia 2025, where Adrian Marcellus represented YB Gobind Singh Deo and reaffirmed Malaysias commitment to accelerating digital transformation and advancing our vision of becoming an AI Nation by 2030. He emphasised clear timelines, strong digital-talent development, and embedding AI and innovation as national disciplines.</p><p style="text-align: left;"><br></p><p style="text-align: left;">The event, themed <strong>Future-Ready Malaysia: Innovation, Resilience, Growth</strong>, marked the final edition of the Think Big Malaysia 2025 series and strengthened collaboration with industry partners like Canon toward an inclusive, future-ready digital economy.</p>	public	published	\N	1	1	0	2	2	2025-11-24 05:12:18	2025-12-04 03:15:17	\N
