15	2	<p style="text-align: left;">Were delighted to share this - YBhg. Tuan Fabian Bigar and Puan Ellina Roslan were among the featured speakers at the Global Public Relations Conference and Festival Malaysia (GPRCFMY 2025) held at WTCKL from 13 - 15 November 2025.</p><p style="text-align: left;"><br></p><p style="text-align: left;">On the final day, YBhg. Tuan Fabian delivered a Ministerial speech on behalf of YB Gobind Singh Deo, highlighting the importance of digital ethics, governance and responsible technology adoption.</p><p style="text-align: left;"></p><p style="text-align: left;">Puan Ellina later joined a panel on Power and Responsibility: Navigating Influence in a Synthetic World, discussing how AI and synthetic media are reshaping communication. She emphasised the need for strong digital governance, a whole-of-nation approach to inclusivity, and using AI as a tool to enhance efficiency while maintaining trust and ethical standards.</p>	public	published	\N	1	0	0	2	2	2025-11-26 02:15:15	2025-12-01 06:15:12	\N
