6	2	2	Digital Service Optimization for Malaysian Public Agencies	digital-service-optimization-for-malaysian-public-agencies-ym9b5ebtRz	<p>This project focuses on identifying inefficiencies within a selected Malaysian government agencys digital services and proposing a streamlined, user-centric service delivery model. The initiative includes mapping current service flows, analyzing citizen experience gaps, and recommending improvements using automation, digital forms, and data-driven decision-making.</p>	\N	\N	\N	[]	public	2025-11-25	2025-12-06	2	2	2025-11-24 04:38:17	2025-11-30 04:34:50	\N
2	2	10	Cybersecurity Strengthening Roadmap for Malaysian Organizations	cybersecurity-strengthening-roadmap-for-malaysian-organizations-E0l8UGQ7zs	<p style="text-align: left;">This project delivers a comprehensive cybersecurity readiness roadmap focusing on governance, threat monitoring, employee awareness, and PDPA compliance. It helps organizations adopt a modern cybersecurity posture and align with Malaysian national cybersecurity strategies.</p>	\N	\N	\N	[]	public	2025-11-25	2025-12-04	2	2	2025-11-24 04:32:18	2025-12-01 06:18:12	\N
7	2	4	Smart Workforce Enablement for Malaysian SMEs	smart-workforce-enablement-for-malaysian-smes-rpbuzY1PQ0	<p style="text-align: left;">This project aims to equip small and medium enterprises (SMEs) in Malaysia with a structured roadmap for digital workforce readiness. It includes assessing digital skill gaps, proposing upskilling strategies, and creating a digital competency model that aligns with Malaysia's national digital economy goals (MyDIGITAL).</p>	\N	\N	\N	[]	public	2025-12-04	2026-01-21	2	2	2025-11-24 04:38:50	2025-12-01 06:16:34	\N
9	2	2	Digital Customer Experience (CX) Transformation for Malaysian Enterprises	digital-customer-experience-cx-transformation-for-malaysian-enterprises-l1EDNli6Kr	<p><span style="color: rgb(107, 114, 128);">This project evaluates customer journeys within a Malaysian organization and introduces a digital transformation plan to improve touchpoints across web, mobile, and service centers. The outcome includes a redesigned CX flow, KPIs for measuring digital experience, and integration opportunities with omnichannel systems.</span></p>	\N	\N	\N	[]	public	2025-11-25	2025-12-06	2	2	2025-11-24 04:41:32	2025-11-30 10:29:56	\N
8	2	3	Data Governance Framework for Sustainable Corporate Decision-Making	data-governance-framework-for-sustainable-corporate-decision-making-gOIIAlu3zY	<p style="text-align: left;"><br></p><p style="text-align: left;">This project develops a practical data governance framework tailored for Malaysian corporate environments. It addresses issues such as data quality, access control, privacy compliance (PDPA), and analytics capability maturityhelping leaders make informed and trustworthy business decisions.</p><p style="text-align: left;"><br></p><p style="text-align: left;"><br></p><p style="text-align: left;"><br></p>	\N	\N	\N	[]	public	2025-11-27	2025-12-06	2	2	2025-11-24 04:40:57	2025-12-01 06:16:48	\N
10	2	1	ESG & Digital Innovation Blueprint for Malaysian Organisations	esg-digital-innovation-blueprint-for-malaysian-organisations-LB9paH9U3f	<p style="text-align: left;">This project integrates Environmental, Social, and Governance (ESG) priorities with digital strategies to help Malaysian organizations meet sustainability goals. It outlines how digital toolsIoT sensors, dashboards, automation, and data analyticscan track and reduce environmental impact, improve transparency, and support long-term sustainability reporting.</p><p style="text-align: left;"></p><p style="text-align: left;"><br></p>	\N	\N	\N	[]	public	2025-11-18	2025-11-29	2	2	2025-11-24 04:42:07	2025-12-01 06:25:20	\N
4	2	1	AI-Driven Predictive Maintenance Model for Malaysian Industries	ai-driven-predictive-maintenance-model-for-malaysian-industries-USwE1XjSFO	<p style="text-align: left;">This project introduces a predictive maintenance strategy using AI and IoT sensors for manufacturing plants or utilities in Malaysia. It outlines system architecture, organizational readiness, data requirements, and expected ROI from reduced downtime and operational efficiency.</p><p style="text-align: left;"><br></p><p style="text-align: left;"><br></p><p style="text-align: left;"><br></p>	\N	\N	\N	[]	public	2025-11-19	2025-12-05	2	2	2025-11-24 04:36:56	2025-12-01 06:17:53	\N
3	2	6	Digital Health Services Enhancement Framework for Malaysian Healthcare	digital-health-services-enhancement-framework-for-malaysian-healthcare-xBcNyKuGj7	<p style="text-align: left;">This project proposes a digital enhancement plan for healthcare facilities through telemedicine, e-prescriptions, online appointments, and unified patient records. It includes feasibility analysis, risk assessment, and policy alignment with Malaysias digital health agenda.</p>	\N	\N	\N	[]	public	2025-11-25	2025-12-04	2	2	2025-11-24 04:32:49	2025-12-01 06:18:04	\N
5	2	7	National Digital Literacy Acceleration Framework	national-digital-literacy-acceleration-framework-geMQlduLn5	<p style="text-align: left;">This project designs a scalable framework to improve digital literacy among Malaysian communities, focusing on rural and underserved populations. It includes competency mapping, training pathways, and collaboration models between government agencies, universities, and private sectors.</p>	\N	\N	\N	[]	public	2025-11-25	2025-12-06	2	2	2025-11-24 04:37:31	2025-12-01 06:17:08	\N
1	2	8	Smart Campus Transformation Blueprint for Malaysian Education Institutions	smart-campus-transformation-blueprint-for-malaysian-education-institutions-XywXwwL2wL	<p style="text-align: left;">This project provides a roadmap for implementing smart campus technologies  such as digital attendance, learning analytics, smart access control, IoT labs, and green campus sensors  supporting Malaysias higher education digital transformation goals.</p>	\N	\N	\N	[]	public	2025-11-25	2025-12-04	2	2	2025-11-24 04:30:31	2025-12-01 06:19:31	\N
